$(document).ready(function(){$("body").on("fileActionEvent",function(d,e){if(e.obj.hasClass("disabled")||!e.obj.hasClass("dwnload")){return}if(e.obj.hasClass("listaction")){var a=$("#fileList tr.selected.is-file:visible");var c=a.length>0?$.map(a,function(g,f){return $(g).attr("data-file")}):new Array(!e.file?"":e.file);file=c[0]}else{file=e.file}if(!e.obj.hasClass("disablebinarydownload")){window.location.href=window.location.pathname+"?"+$.param({action:"dwnload",file:file})}else{var b=window.location.pathname.lastIndexOf("/")+1==window.location.pathname.length?"":"/";window.location.href=window.location.pathname+b+file}})});